import { useState } from "react";

const [numero, setNumero] = useState(0);

const handleMinus = () => {
    setNumero(numero - 1);
}
const handlePlus = () => {
    setNumero(numero + 1);

};
const Contador = () => {
    <div>
        <button onClick={handlePlus}>+</button>
        <div>{numero}</div>
        <button onClick={handleMinus}>-</button>
    </div>
}
export default Contador;
